INSERT INTO `severity_level_data` VALUES (1,'iwakura-op','レベル1','状況確認→連絡(電話/メール)→対応→連絡(電話/メール)','重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケース。','h2. [[iwakura-op:レベル1]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル1は、重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケースです。\r\n\r\n障害対応レベル1の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# お客様へ電話やチケットで第一報の連絡を行います。\r\n# 状況を詳細に確認し、確認した内容と復旧のための対応方針をチケットで連絡します。\r\n# 復旧対応を行い、対応内容をチケットで連絡します。\r\n\r\n{{include(iwakura-op:連絡先)}}'),(2,'iwakura-op','レベル2','状況確認→連絡(メール)→対応→連絡(メール)','復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケース。','h2. [[iwakura-op:レベル2]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル2は、復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケースです。\r\n\r\n障害対応レベル2の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# お客様へチケットで第一報の連絡を行います。\r\n# 状況を詳細に確認し、確認した内容と復旧のための対応方針をチケットで連絡します。\r\n# 復旧対応を行い、対応内容をチケットで連絡します。'),(3,'iwakura-op','レベル3','自動通知(メール)','障害検知時のご連絡として、監視システムから自動メール通知のみを実施するケース。','h2. [[iwakura-op:レベル3]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル3は、障害検知時のご連絡として、監視システムから自動メール通知のみを実施するケースです。\r\n\r\n障害対応レベル3の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n障害検知した内容が監視システムから自動メール通知されます。\r\nアールワークスの担当者が実施する障害報告・復旧作業はありません。'),(4,'naniwa-univ-op','レベル1','状況確認→連絡(電話/メール)→対応→連絡(電話/メール)','重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケース。','h2. [[naniwa-univ-op:レベル1]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル1は、重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケースです。\r\n\r\n障害対応レベル1の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# お客様へ電話やチケットで第一報の連絡を行います。\r\n# 状況を詳細に確認し、確認した内容と復旧のための対応方針をチケットで連絡します。\r\n# 復旧対応を行い、対応内容をチケットで連絡します。\r\n\r\n{{include(naniwa-univ-op:連絡先)}}\r\n'),(5,'naniwa-univ-op','レベル2','状況確認→連絡(メール)→対応→連絡(メール)','復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケース。','h2. [[naniwa-univ-op:レベル2]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル2は、復旧について貴校との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケースです。\r\n\r\n障害対応レベル2の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# お客様へチケットで第一報の連絡を行います。\r\n# 状況を詳細に確認し、確認した内容と復旧のための対応方針をチケットで連絡します。\r\n# 復旧対応を行い、対応内容をチケットで連絡します。\r\n'),(6,'mineya-shuzou-op','レベル1','サービス影響があり、弊社のみで対応不可な障害','貴社に電話+チケット、峰屋酒造様にチケット(メール)でご連絡','h2. [[mineya-shuzou-op:レベル1]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル1は、重要なサービスが停止した場合等、電話にてABC社様へ緊急連絡を差し上げた上で対応を実施するケースです。\r\n*また、障害報告は峰屋酒造様への報告も必要です。*\r\n\r\n{{include(障害対応時共通注意事項)}}\r\n\r\nh3. 連絡手順\r\n\r\n# 手早く状況を確認します。\r\n# 障害が発生中と確認できたら、峰屋酒造様にチケットにて第一報を連絡します。( \"峰屋酒造様チケット報告手順\":[[障害報告]] )\r\n# [[mineya-shuzou-op:ABC社様_連絡先]]に記載のある連絡先へ、上から順につながるまで電話にて障害報告を行います。\r\n# ABC社様へ復旧対応をお願いした場合は、 \"こちら\": #1 を基に、復旧対応依頼チケットを起票します。\r\n(以降の、ABC社様とRworks間のみのやり取りは、復旧対応依頼チケットで行います)\r\n# ABC社様と連携して復旧対応を行います。\r\n\r\n{{include(mineya-shuzou-op:連絡先)}}\r\n\r\n{{include(mineya-shuzou-op:障害報告)}}'),(7,'mineya-shuzou-op','レベル2','サービス影響があるが、弊社のみで対応可能な障害','貴社にチケット、峰屋酒造様にチケット(メール)でご連絡','h2. [[mineya-shuzou-op:レベル2]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル2は、復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケースです。\r\n\r\n障害対応レベル2の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n*また、障害報告は峰屋酒造様への報告も必要です。*\r\n\r\n{{include(障害対応時共通注意事項)}}\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# 峰屋酒造様にチケットにて第一報を連絡します。\r\n# 以後は、進捗をチケット更新することで連絡します。\r\n\r\nh2. 峰屋酒造様チケット報告手順\r\n\r\n{{include(mineya-shuzou-op:障害報告)}}'),(8,'mineya-shuzou-op','レベル3','サービス影響がないが、早急な復旧対応が必要な障害(ディスク使用率の急上昇など)','貴社に電話+チケットでご連絡、峰屋酒造様にはご連絡しない','h2. [[mineya-shuzou-op:レベル3]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル3は、サービスに影響のないが早期対応が必要な障害が発生した場合等、電話にてABC様へ緊急連絡を差し上げた上で対応を実施するケースです。\r\n*峰屋酒造様への障害報告は不要です。*\r\n\r\n{{include(障害対応時共通注意事項)}}\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# 障害が発生中と確認できたら、チケットにて第一報を連絡します。\r\n# [[mineya-shuzou-op:ABC社様_連絡先]]に記載のある連絡先へ、上から順につながるまで電話にて障害報告を行います。\r\n# ABC様と連携して復旧対応を行います。\r\n\r\n\r\nh2. チケット報告手順\r\n\r\n{{include(mineya-shuzou-op:障害報告_ABC)}}\r\n\r\n'),(9,'mineya-shuzou-op','レベル4','サービス影響はなく、弊社のみで対応可能、または早急な復旧対応が不要な障害','貴社にチケットでご連絡、峰屋酒造様にはご連絡しない','h2. [[mineya-shuzou-op:レベル4]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル4は、サービスに影響のない障害が発生した場合等、チケットのみで報告を実施するケースです。\r\n*峰屋酒造様への障害報告は不要です。*\r\n\r\n{{include(障害対応時共通注意事項)}}\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# 障害が発生中と確認できたら、チケットにて第一報を連絡します。\r\n# 復旧対応が可能であれば実施します。\r\n\r\nh2. チケット報告手順\r\n\r\n{{include(mineya-shuzou-op:障害報告_ABC)}}\r\n\r\n'),(10,'kitasanriku-sodegahama-gyokyo-op','レベル1','状況確認→連絡(電話/メール)→対応→連絡(電話/メール)','重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケース。','h2. [[kitasanriku-sodegahama-gyokyo-op:レベル1]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル1は、重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケースです。\r\n\r\n障害対応レベル1の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# お客様へ電話やチケットで第一報の連絡を行います。\r\n# 状況を詳細に確認し、確認した内容と復旧のための対応方針をチケットで連絡します。\r\n# 復旧対応を行い、対応内容をチケットで連絡します。\r\n\r\n{{include(kitasanriku-sodegahama-gyokyo-op:顧客緊急連絡先)}}\r\n'),(11,'kitasanriku-sodegahama-gyokyo-op','レベル2','状況確認→連絡(メール)→対応→連絡(メール)','復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケース。','h2. [[kitasanriku-sodegahama-gyokyo-op:レベル2]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル2は、復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケースです。\r\n\r\n障害対応レベル2の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# お客様へチケットで第一報の連絡を行います。\r\n# 状況を詳細に確認し、確認した内容と復旧のための対応方針をチケットで連絡します。\r\n# 復旧対応を行い、対応内容をチケットで連絡します。\r\n'),(12,'kitasanriku-sodegahama-gyokyo-op','レベル3','自動通知(メール)','障害検知時のご連絡として、監視システムから自動メール通知のみを実施するケース。','h2. [[kitasanriku-sodegahama-gyokyo-op:レベル3]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル3は、障害検知時のご連絡として、監視システムから自動メール通知または自動チケット起票のみを実施するケースです。\r\n\r\n障害対応レベル3の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n障害検知した内容が監視システムから自動メール通知または自動チケット起票されます。\r\nアールワークスの担当者が実施する障害報告・復旧作業はありません。\r\n'),(13,'kitasanriku-railway-op','レベル1','状況確認→連絡(電話/メール)→対応→連絡(電話/メール)','重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケース。','h2. [[kitasanriku-railway-op:レベル1]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル1は、重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケースです。\r\n\r\n障害対応レベル1の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# お客様へ電話やチケットで第一報の連絡を行います。\r\n# 状況を詳細に確認し、確認した内容と復旧のための対応方針をチケットで連絡します。\r\n# 復旧対応を行い、対応内容をチケットで連絡します。\r\n\r\n{{include(kitasanriku-railway-op:連絡先)}}\r\n'),(14,'kitasanriku-railway-op','レベル2','状況確認→連絡(メール)→対応→連絡(メール)','復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケース。','h2. [[kitasanriku-railway-op:レベル2]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル2は、復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケースです。\r\n\r\n障害対応レベル2の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# お客様へチケットで第一報の連絡を行います。\r\n# 状況を詳細に確認し、確認した内容と復旧のための対応方針をチケットで連絡します。\r\n# 復旧対応を行い、対応内容をチケットで連絡します。\r\n'),(15,'kitasanriku-railway-op','レベル3','自動通知(メール)','障害検知時のご連絡として、監視システムから自動メール通知のみを実施するケース。','h2. [[kitasanriku-railway-op:レベル3]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル3は、障害検知時のご連絡として、監視システムから自動メール通知のみを実施するケースです。\r\n\r\n障害対応レベル3の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n障害検知した内容が監視システムから自動メール通知されます。\r\nアールワークスの担当者が実施する障害報告・復旧作業はありません。\r\n'),(16,'jittoku-nagaya-inner','レベル1','状況確認 および 緊急連絡','電話、チケットによる緊急連絡','h2. ① 状況確認\r\n\r\n# {{include(pandora_console)}}\r\n# {{include(監視対象機器)}}\r\n# 状況判断\r\n|_. 状況                           |_. 対応内容|\r\n|障害が発生中 or 障害発生もすぐ復旧|以下②以降の手順へ進む|\r\n|障害じゃなかった                  |社内宛てに連絡をして対応完了|\r\n\r\nh2. ② お客様へ障害検知を電話連絡し、エスカレーションしてください。 ([[緊急電話連絡先]])\r\n\r\n{{include(緊急電話連絡先)}}\r\n\r\nh2. ③ 電話連絡後、「障害対応」チケットを起票 ([[障害対応チケット]])\r\n\r\n{{include(障害対応チケット)}}\r\n\r\nh2. ④ 復旧手順\r\n\r\n* 復旧作業はお客様にて実施します。\r\n* お客様から作業依頼を受けた場合、依頼に従って作業してください。\r\n\r\n\r\nh2. ⑤ 復旧通知を受け取る\r\n\r\n* お客様作業により、復旧通知が届くはずです。\r\n\r\n\r\nh2. ⑥ お客様へ障害復旧を電話連絡 ([[緊急電話連絡先]])\r\n\r\n{{include(緊急電話連絡先)}}\r\n\r\nh2. ⑦ 電話連絡後、③で起票した「障害対応」チケットを更新、終了させる。\r\n\r\n{{include(障害対応チケット)}}\r\n'),(17,'jittoku-nagaya-inner','レベル1N','状況確認、緊急連絡、障害復旧作業','電話、チケットによる連絡','h2. ① 状況確認\r\n\r\n# {{include(pandora_console)}}\r\n# {{include(監視対象機器)}}\r\n# 状況判断\r\n|_. 状況                           |_. 対応内容|\r\n|障害が発生中 or 障害発生もすぐ復旧|以下②以降の手順へ進む|\r\n|障害じゃなかった                  |社内宛てに連絡をして対応完了|\r\n\r\nh2. ② お客様へ障害検知を電話連絡 ([[緊急電話連絡先]])\r\n\r\n{{include(緊急電話連絡先)}}\r\n\r\nh2. ③ 電話連絡後、「障害対応」チケットを起票 ([[障害対応チケット]])\r\n\r\n{{include(障害対応チケット)}}\r\n\r\nh2. ④ 復旧手順\r\n\r\n* 主担当 and/or お客様と相談しながら対応\r\n* 障害毎に手順がある場合は、手順にそって対応\r\n* 弊社にて対応不可能な障害の場合、お客様にエスカレーションし、以降お客様による復旧作業を待ってください。\r\n\r\nh2. ⑤ お客様へ障害復旧を電話連絡 ([[緊急電話連絡先]])\r\n\r\n{{include(緊急電話連絡先)}}\r\n\r\nh2. ⑥ 電話連絡後、③で起票した「障害対応」チケットを更新、終了させる。\r\n\r\n{{include(障害対応チケット)}}\r\n'),(18,'jittoku-nagaya-inner','レベル3','状況確認、障害復旧作業、通常連絡','チケットによる連絡','h2. ① 状況確認\r\n\r\n# {{include(pandora_console)}}\r\n# {{include(監視対象機器)}}\r\n# 状況判断\r\n|_. 状況                           |_. 対応内容|\r\n|障害が発生中 or 障害発生もすぐ復旧|以下②以降の手順へ進む|\r\n|障害じゃなかった                  |社内宛てに連絡をして対応完了|\r\n\r\nh2. ② 復旧手順\r\n\r\n* 主担当 and/or お客様と相談しながら対応\r\n* 障害毎に手順がある場合は、手順にそって対応\r\n* 弊社にて対応不可能な障害の場合、お客様にエスカレーションし、以降お客様による復旧作業を待ってください。\r\n\r\nh2. ③ 「障害対応」チケットを終了ステータスで起票する。\r\n\r\n{{include(障害対応チケット)}}\r\n'),(19,'acron-layout-op','レベル1','状況確認→連絡(電話/メール)→対応→連絡(電話/メール)','重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケース。','h2. [[acron-layout-op:レベル1]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル1は、重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケースです。\r\n\r\n障害対応レベル1の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# お客様へ電話やチケットで第一報の連絡を行います。\r\n# 状況を詳細に確認し、確認した内容と復旧のための対応方針をチケットで連絡します。\r\n# 復旧対応を行い、対応内容をチケットで連絡します。\r\n'),(20,'acron-layout-op','レベル2','状況確認→連絡(メール)→対応→連絡(メール)','復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケース。','h2. [[acron-layout-op:レベル2]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル2は、復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケースです。\r\n\r\n障害対応レベル2の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n# 手早く状況を確認します。\r\n# お客様へチケットで第一報の連絡を行います。\r\n# 状況を詳細に確認し、確認した内容と復旧のための対応方針をチケットで連絡します。\r\n# 復旧対応を行い、対応内容をチケットで連絡します。\r\n'),(21,'acron-layout-op','レベル3','自動通知(メール)','障害検知時のご連絡として、監視システムから自動メール通知のみを実施するケース。','h2. [[acron-layout-op:レベル3]]\r\n\r\nh3. 概要\r\n\r\n障害対応レベル3は、障害検知時のご連絡として、監視システムから自動メール通知のみを実施するケースです。\r\n\r\n障害対応レベル3の監視項目において障害検知した際の一般的な対応は下記の通りです。監視項目別に説明がある場合はそちらに従って対応します。\r\n\r\nh3. 対応手順\r\n\r\n障害検知した内容が監視システムから自動メール通知されます。\r\nアールワークスの担当者が実施する障害報告・復旧作業はありません。\r\n'),(22,'sekimachi-op','レベル1','サービスに影響のある障害です。 電話連絡による第一報を行った上で、復旧対応を行います。 → [[顧客緊急連絡先]]',NULL,NULL),(23,'sekimachi-op','レベル2','冗長化されたサービスの片系障害など、直ちにサービス影響の発生しない障害です。 チケットによる報告を行った上で、復旧対応を行います。',NULL,NULL),(24,'sekimachi-op','レベル3','サービスに影響のない障害です。 内容確認をした上で、チケットによる報告となります。',NULL,NULL),(25,'diningmanner-op','電話 + チケット',NULL,NULL,'お電話にて第一報の障害発生連絡を行います。その後、チケットを起票して、対応状況を都度、チケットにて報告いたします。'),(26,'diningmanner-op','チケット',NULL,NULL,'チケット起票により、障害発生通知を行います。対応状況は都度、チケットにて報告いたします。'),(27,'ladderpencil-op','電話 + チケット',NULL,NULL,'お電話にて第一報の障害発生連絡を行います。その後、チケットを起票して、対応状況を都度、チケットにて報告いたします。'),(28,'ladderpencil-op','チケット',NULL,NULL,'チケット起票により、障害発生通知を行います。対応状況は都度、チケットにて報告いたします。'),(29,'nerimarubber-op','電話 + チケット',NULL,NULL,'お電話にて第一報の障害発生連絡を行います。その後、チケットを起票して、対応状況を都度、チケットにて報告いたします。'),(30,'nerimarubber-op','チケット',NULL,NULL,'チケット起票により、障害発生通知を行います。対応状況は都度、チケットにて報告いたします。'),(31,'diningmanner-www-trouble-op','電話 + チケット',NULL,NULL,'お電話にて第一報の障害発生連絡を行います。その後、チケットを起票して、対応状況を都度、チケットにて報告いたします。'),(32,'diningmanner-www-trouble-op','チケット',NULL,NULL,'チケット起票により、障害発生通知を行います。対応状況は都度、チケットにて報告いたします。'),(33,'diningmanner-temple-trouble-op','電話 + チケット',NULL,NULL,'お電話にて第一報の障害発生連絡を行います。その後、チケットを起票して、対応状況を都度、チケットにて報告いたします。'),(34,'diningmanner-temple-trouble-op','チケット',NULL,NULL,'チケット起票により、障害発生通知を行います。対応状況は都度、チケットにて報告いたします。'),(35,'diningmanner-lan-trouble-op','チケット',NULL,NULL,'即時直接的業務影響が発生するものではないため、チケット起票により、障害発生通知を行います。\n対応状況は都度、チケットにて報告いたします。'),(36,'diningmanner-galaxy-trouble-op','電話 + チケット',NULL,NULL,'お電話にて第一報の障害発生連絡を行います。その後、チケットを起票して、対応状況を都度、チケットにて報告いたします。'),(37,'diningmanner-galaxy-trouble-op','チケット',NULL,NULL,'チケット起票により、障害発生通知を行います。対応状況は都度、チケットにて報告いたします。'),(38,'diningmanner-datalake-trouble-op','電話 + チケット',NULL,NULL,'お電話にて第一報の障害発生連絡を行います。その後、チケットを起票して、対応状況を都度、チケットにて報告いたします。'),(39,'diningmanner-datalake-trouble-op','チケット',NULL,NULL,'チケット起票により、障害発生通知を行います。対応状況は都度、チケットにて報告いたします。'),(40,'kaifuku-lab-op','レベル1','状況確認→連絡(電話/メール)→対応→連絡(電話/メール)','重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケース。',NULL),(41,'kaifuku-lab-op','レベル2','状況確認→連絡(メール)→対応→連絡(メール)','復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケース。',NULL),(42,'kaifuku-lab-op','レベル3','自動通知(メール)','障害検知時のご連絡として、監視システムから自動メール通知のみを実施するケース。',NULL),(43,'kaifuku-tp-op','レベル1','状況確認→連絡(電話/メール)→対応→連絡(電話/メール)','重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケース。',NULL),(44,'kaifuku-tp-op','レベル2','状況確認→連絡(メール)→対応→連絡(メール)','復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケース。',NULL),(45,'kaifuku-tp-op','レベル3','自動通知(メール)','障害検知時のご連絡として、監視システムから自動メール通知のみを実施するケース。',NULL),(46,'kaifuku-bcg-op','レベル1','状況確認→連絡(電話/メール)→対応→連絡(電話/メール)','重要なサービスが停止した場合等、電話にて貴社へ緊急連絡を差し上げた上で対応を実施するケース。',NULL),(47,'kaifuku-bcg-op','レベル2','状況確認→連絡(メール)→対応→連絡(メール)','復旧について貴社との調整が不要な障害で、随時メールにて状況報告しながら対応を実施するケース。',NULL),(48,'kaifuku-bcg-op','レベル3','自動通知(メール)','障害検知時のご連絡として、監視システムから自動メール通知のみを実施するケース。',NULL);
